@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent {
  title = 'MailingListWebApp';
}

let submitted = false;


function toggleSubmitted() {
  submitted= !submitted;
}



<mat-toolbar color="primary">
  <span>Mailing List</span>
</mat-toolbar>
